@vibovitold A chess player can tell when someone who does not play chess speaks about chess. It's not just the mispronouncing of names, it's in the little stuff like that. A file and an open file are different, there's is the half-open file, a 'file' is meaningless term in chess. Taking a file means nothing. Taking an open file is meaningful. If you were a chess player, you would notice all of these little errors and recognize it. I wasn't trying to be a dick, just suggesting that maybe someone involved should've ran a script by someone who played chess, or spent more time watching/listening to how chess players actually talk. .Repeatedly, throughout this video, he uses terms and phrases that are meaningless in chess terms. Find someone you know and ask him what the difference between an open file is for a rook, a half open file and a file. 
They are distinct and mean different things. 
Cheers. It is not a distinction without a difference.

